module.exports = "<h1 id=\"gdpr-compliance-what-organizations-need-to-know\">GDPR Compliance: What Organizations Need to Know</h1>\n<p>With the <a href=\"https://en.wikipedia.org/wiki/General_Data_Protection_Regulation\">General Data Protection Regulation (GDPR)</a> going into effect on May 25th, 2018, companies have less than a year to get ready, and many are starting to panic. Europe has been a leader in data security and privacy requirements, but GDPR compliance raises the stakes, with stricter rules, heavier fines and broad jurisdiction within the EU.</p>\n<blockquote>\n<p>Oktoberfest is super awesome, we all should try going at least once.</p>\n</blockquote>\n<p>But the new regulations are not as daunting as they seem. Privacy and data protection rules have been getting stricter and enforcement has been getting tougher for years, and most companies are already required to <a href=\"https://www.virtru.com/blog/secure-business-data/\">secure business data</a> against hackers and other threats. Here’s why you shouldn’t panic just yet.</p>\n<h2 id=\"gdpr-checklist-5-reasons-not-to-panic\">GDPR Checklist: 5 Reasons Not to Panic</h2>\n<h3 id=\"1-gdpr-is-what-you-re-already-doing-under-compliance-requirements-\">1. GDPR is what you’re already doing under compliance requirements.</h3>\n<p>GDPR compliance will likely require significant investment and retraining, but it shouldn’t be brand new. Most compliance regimes already have strict requirements for how you have to treat certain kinds of personal data. If you’re PCI compliant (which most businesses are) there are strict requirements for everything you do with credit card data. You need to encrypt it, only use it in certain systems that have been designed for it, restrict who can access it as much as possible, and submit to quarterly checks for network vulnerabilities.</p>\n<ul>\n<li>something</li>\n<li>something else</li>\n<li>woo, lists!</li>\n</ul>\n<h3 id=\"2-gdpr-is-an-opportunity-to-unify-your-data-protection-strategy-\">2. GDPR is an opportunity to unify your data protection strategy.</h3>\n<p>For many companies, the most difficult and costly thing about compliance isn’t so much the strictness of the requirements, but the sheer range of requirements. A diversified enterprise could easily be on the hook for half a dozen major compliance regimes, and dozens more different state and regional data privacy and security laws, that you may not even be aware of. </p>\n<h4 id=\"another-title-here\">another title here</h4>\n<p>Jurisdictional boundaries are complex and haven’t been thoroughly tested yet, but you’re theoretically on the hook for data protection laws anywhere you sell a product, even if you don’t operate there.</p>\n<table>\n<thead>\n<tr>\n<th>Tables</th>\n<th style=\"text-align:center\">Are</th>\n<th style=\"text-align:right\">Cool</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>col 3 is</td>\n<td style=\"text-align:center\">right-aligned</td>\n<td style=\"text-align:right\">$1600</td>\n</tr>\n<tr>\n<td>col 2 is</td>\n<td style=\"text-align:center\">centered</td>\n<td style=\"text-align:right\">$12</td>\n</tr>\n<tr>\n<td>zebra stripes</td>\n<td style=\"text-align:center\">are neat</td>\n<td style=\"text-align:right\">$1</td>\n</tr>\n</tbody>\n</table>\n";

